import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { GoogleMap, Marker } from '@react-google-maps/api';
import MyComponent from './map';

function App() {
  const [data, setData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const rowsPerPage = 25;

  useEffect(() => {
    axios.get('https://api.lgbusiness.net/api/v1/events/')
      .then(response => setData(response.data.instances));
  }, []);

  const totalPages = Math.ceil(data.length / rowsPerPage);
  const startIndex = (currentPage - 1) * rowsPerPage;
  const endIndex = startIndex + rowsPerPage;
  const currentRows = data.slice(startIndex, endIndex);

  const handlePageChange = page => {
    setCurrentPage(page);
  };

  function buyInstance(instance) {
    fetch('https://api.lgbusiness.net/api/v1/events/purchase', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        "groupId": "n0bad9s8d1234vas91234",
        "eventId": instance._id,
        "depositToken": "asdn12390acsd324",
        "quantity": 1,
        "seller": 0
      })
    })
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        console.log('Success:', data);
      })
      .catch(error => {
        console.error('Error:', error);
      });
  }

  const containerStyle = {
    width: '100%',
    height: '400px'
  };

  const center = {
    lat: -3.745,
    lng: -38.523
  };

  return (
    <>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Created At</th>
            <th>Updated At</th>
            <th>Name</th>
            <th>Date</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Location</th>
            <th>Latitude</th>
            <th>Longitude</th>
            <th>Compra Aqui</th>
          </tr>
        </thead>
        <tbody>
          {currentRows.map(instance => (
            <tr key={instance._id}>
              <td>{instance._id}</td>
              <td>{instance.createdAt}</td>
              <td>{instance.updatedAt}</td>
              <td>{instance.name}</td>
              <td>{instance.date}</td>
              <td>{instance.price}</td>
              <td>{instance.quantity}</td>
              <td>{instance.location}</td>
              <td>{instance.latitude}</td>
              <td>{instance.longitude}</td>
              <td>
                {instance.quantity > 0 && (
                  <a href="#" onClick={() => buyInstance(instance)}>
                    Compra ahora
                  </a>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={10}
      onLoad={onLoad}
      onUnmount={onUnmount}
    >
      {currentRows.map(instance => (
        <Marker key={instance._id} position={{lat: instance.latitude, lng: instance.longitude}} />
      ))}
    </GoogleMap>


      <div>
        <button disabled={currentPage === 1} onClick={() => handlePageChange(currentPage - 1)}>
          Prev
        </button>
        {Array.from({ length: totalPages }).map((_, i) => (
          <button key={i} onClick={() => handlePageChange(i + 1)}>
            {i + 1}
          </button>
        ))}
        <button disabled={currentPage === totalPages} onClick={() => handlePageChange(currentPage + 1)}>
          Next
        </button>
      </div>
    </>
  );
}

export default App;
